INSERT INTO `industries_master` VALUES (1,'agriculture','Agriculture','agriculture.png','industry/agriculture','AGR','Farming, agritech, crop science','$4.1 Trillion','+5.3% CAGR','John Deere (USA), Bayer (Germany), Syngenta (Switzerland), Corteva (USA)','Wheat','bg-lime-100 text-lime-700','Agriculture is evolving rapidly with the adoption of precision farming, smart irrigation, agri-biotechnology, and data-driven crop management. Sustainability, yield optimization, and climate-resilient farming practices are shaping modern agricultural markets worldwide.',_binary '','::1','2025-01-08 23:35:24',2,NULL,NULL),(2,'automobile-transportation','Automobile Transportation','automobile-transportation.png','industry/automobile-transportation','ATR','Vehicles, logistics, mobility solutions','$4.5 Trillion','+8.1% CAGR','Toyota (Japan), Volkswagen (Germany), Tesla (USA), BYD (China), Daimler (Germany)','Car','bg-cyan-100 text-cyan-700','The automobile and transportation industry is being reshaped by electric vehicles, autonomous driving, smart logistics, and shared mobility solutions. Technological innovation and sustainability goals are driving transformation across global mobility ecosystems.',_binary '','::1','2025-01-08 23:35:27',2,NULL,NULL),(3,'chemical-material','Chemicals & Materials','chemicals-material.png','industry/chemicals-material','CAM','Specialty chemicals, raw materials','$5.7 Trillion','+4.9% CAGR','BASF (Germany), Dow (USA), SABIC (Saudi Arabia), LyondellBasell (Netherlands)','FlaskConical','bg-teal-100 text-teal-700','The chemicals and materials sector is shifting toward specialty chemicals, sustainable materials, and advanced composites. Innovation in green chemistry, battery materials, and high-performance compounds is driving long-term industry growth.',_binary '','::1','2025-01-08 23:36:01',2,NULL,NULL),(5,'construction','Construction & Real Estate','construction.png','industry/construction','CON','Infrastructure development, construction projects, and real estate','$13 Trillion','+4.7% CAGR','Vinci (France), Larsen & Toubro (India), CBRE (USA), Skanska (Sweden)','Building2','bg-amber-100 text-amber-700','Construction markets are driven by urbanization, infrastructure development, smart cities, and sustainable building practices. Increased public and private investment is fueling growth across residential, commercial, and industrial construction projects.',_binary '','::1','2025-01-08 23:40:02',2,NULL,NULL),(6,'consumer-goods','Consumer Products','consumer-products.png','industry/consumer-products','COP','Retail, lifestyle, consumer goods','$15 Trillion','+5.2% CAGR','Procter & Gamble (USA), Unilever (UK), Nestl (Switzerland), PepsiCo (USA)','ShoppingBag','bg-purple-100 text-purple-700','Consumer goods markets are influenced by changing lifestyles, sustainability preferences, digital commerce, and evolving purchasing behavior. Brands are focusing on omnichannel strategies, private labels, and eco-friendly product innovation.',_binary '','::1','2025-01-08 23:40:04',2,NULL,NULL),(7,'daily-necessities','Daily Necessities','daily-necessities.png','industry/daily-necessities','DNE','Household essentials and daily-use products','$3.2 Trillion','+4.1% CAGR','Unilever (UK), P&G (USA), Reckitt (UK)','Home','bg-slate-100 text-slate-700','Daily necessities remain resilient across economic cycles, supported by steady demand for household essentials. Supply chain efficiency, pricing strategies, and private-label expansion play a critical role in market competitiveness.',_binary '','::1','2025-01-08 23:43:20',2,NULL,NULL),(8,'electronics-semiconductor','Electronics & Semiconductors','electronics-semiconductor.png','industry/electronics-semiconductor','ESC','Chips, electronic components, and semiconductor technologies','$650 Billion','+9.0% CAGR','TSMC (Taiwan), Intel (USA), Samsung (South Korea), Qualcomm (USA)','CircuitBoard','bg-indigo-100 text-indigo-700','The electronics and semiconductor industry powers modern technologies including AI, automotive electronics, consumer devices, and data centers. Ongoing investments in advanced nodes and supply chain diversification are shaping global semiconductor markets.',_binary '','::1','2025-01-08 23:43:22',2,NULL,NULL),(9,'energy-power','Energy & Power','energy-power.png','industry/energy-power','EAP','Renewables, oil & gas, and power generation','$9 Trillion','+6.3% CAGR','Shell (UK), ExxonMobil (USA), NextEra Energy (USA), TotalEnergies (France)','Zap','bg-green-100 text-green-700','Energy markets are transitioning toward renewable sources while balancing global energy security and demand. Investments in clean energy, energy storage, hydrogen technologies, and grid modernization are driving sector transformation.',_binary '','::1','2025-01-08 23:46:18',2,NULL,NULL),(10,'food-beverages','Food, Beverage & Nutrition','food-beverages-nutrition.png','industry/food-beverages-nutrition','FBN','Food processing, beverages, and nutrition products','$8.4 Trillion','+6.0% CAGR','Nestl (Switzerland), Danone (France), PepsiCo (USA), Coca-Cola (USA)','UtensilsCrossed','bg-orange-100 text-orange-700','The food and beverage industry continues steady growth driven by health awareness, functional nutrition, plant-based diets, and improved food processing technologies. Cold-chain logistics and sustainability are key focus areas globally.',_binary '','::1','2025-01-08 23:46:59',2,NULL,NULL),(12,'internet-communication','Internet Communication','internet-communication.png','industry/internet-communication','ICO','Internet infrastructure, telecom, and communication technologies','$2.8 Trillion','+7.9% CAGR','AT&T (USA), Verizon (USA), Deutsche Telekom (Germany), Vodafone (UK)','Globe ','bg-violet-100 text-violet-700','Internet and communication markets are driven by increasing data consumption, digital connectivity, cloud services, and next-generation telecom infrastructure. Expansion of broadband, 5G, and global networks is fueling long-term growth.',_binary '','::1','2025-01-08 23:48:45',2,NULL,NULL),(13,'machinery-equipment','Industrial Automation','industrial-automation.png','industry/industrial-automation','IAU','Manufacturing machinery, industrial equipment, and automation systems','$320 Billion','+10.8% CAGR','Siemens (Germany), ABB (Switzerland), Rockwell Automation (USA), Schneider Electric (France)','Factory','bg-gray-100 text-gray-700','Industrial automation is transforming manufacturing through smart factories, robotics, AI-driven optimization, and Industry 4.0 technologies. Companies are adopting automation to improve efficiency, productivity, and operational resilience.',_binary '','::1','2025-01-08 23:49:06',2,NULL,NULL),(14,'medical-care','Healthcare IT & Services','healthcare-it-services.png','industry/healthcare-it-services','HSR','Health IT platforms, medical services, and digital healthcare solutions','$420 Billion','+12.2% CAGR','Epic Systems (USA), Cerner (USA), Philips (Netherlands), GE HealthCare (USA)','Hospital','bg-rose-100 text-rose-700','Healthcare IT and services are transforming care delivery through digital health platforms, telemedicine, electronic health records, and advanced analytics. Technology adoption is improving patient outcomes and operational efficiency.',_binary '','::1','2025-01-09 00:25:24',2,NULL,NULL),(15,'Medical Devices Consumables','Medical devices consumables','medical-devices-consumables.png','industry/medical-devices-consumables','MDC','Medical consumables, disposables, and healthcare devices','$520 Billion','+7.1% CAGR','Medtronic (Ireland), 3M (USA), Becton Dickinson (USA), Cardinal Health (USA)','Syringe','bg-pink-100 text-pink-700','Medical devices and consumables are experiencing strong demand driven by aging populations, rising healthcare access, and infection prevention needs. Single-use devices and hospital consumables are key growth segments.',_binary '','::1','2025-01-09 00:25:58',2,NULL,NULL),(16,'Medical Devices','Medical Devices','medical-devices.png','industry/medical-devices','MDE','Diagnostic and therapeutic medical devices','$610 Billion','+6.9% CAGR','Medtronic (Ireland), GE HealthCare (USA), Siemens Healthineers (Germany)','Stethoscope','bg-red-100 text-red-700','Medical devices innovation is fueled by advances in diagnostics, imaging technologies, minimally invasive procedures, and home healthcare solutions. Regulatory approvals and AI-enabled devices are accelerating market expansion.',_binary '','::1','2025-01-09 00:43:57',2,NULL,NULL),(17,'new-technology','Technology','technology.png','industry/technology','TEC','Software, hardware, and digital technology solutions','$6 Trillion','+9.5% CAGR','Microsoft (USA), Apple (USA), Google (USA), Amazon (USA), NVIDIA (USA)','Cpu','bg-blue-100 text-blue-700','Technology underpins digital transformation across industries, driven by rapid growth in artificial intelligence, cloud computing, cybersecurity, and software platforms. Continuous innovation is reshaping global business and consumer ecosystems.',_binary '','::1','2025-01-09 00:46:07',2,NULL,NULL),(18,'packaging','Packaging & Transport','packaging-transport.png','industry/packaging-transport','PAT','Packaging solutions and transport logistics','$1.1 Trillion','+6.6% CAGR','Amcor (Switzerland), International Paper (USA), DS Smith (UK)','Package','bg-yellow-100 text-yellow-700','Packaging markets are driven by e-commerce growth, sustainability initiatives, and demand for efficient logistics solutions. Eco-friendly materials and automated packaging systems are key industry trends.',_binary '','::1','2025-01-09 00:48:39',2,NULL,NULL),(19,'Pharma-Healthcare','Pharmaceutical','pharmaceutical.png','industry/pharmaceutical','PHA','Pharmaceutical drugs, therapeutics, and life sciences','$1.7 Trillion','+6.4% CAGR','Pfizer (USA), Roche (Switzerland), Novartis (Switzerland), Johnson & Johnson (USA)','Pill','bg-rose-100 text-rose-700','The pharmaceutical industry is driven by innovation in biologics, personalized medicine, and accelerated drug development. Emerging markets, R&D investment, and AI-powered discovery are shaping future growth.',_binary '','::1','2025-01-09 00:49:13',2,NULL,NULL),(20,'service-software','IT Security & Software','it-security-software.png','industry/it-security-software','ITS','Cybersecurity solutions and enterprise software','$290 Billion','+11.5% CAGR','Palo Alto Networks (USA), Fortinet (USA), CrowdStrike (USA), Cisco (USA)','Shield','bg-indigo-100 text-indigo-700','IT security and software markets are expanding rapidly due to rising cyber threats, cloud adoption, and digital transformation. Enterprises are investing heavily in cybersecurity platforms, zero-trust frameworks, and AI-driven threat detection.',_binary '','::1','2025-01-09 01:04:17',2,NULL,NULL),(21,'Service','Services & Utilities','services-utilities.png','industry/services-utilities','SAU','Business services, utilities, and infrastructure services','$6.2 Trillion','+4.5% CAGR','Veolia (France), ENGIE (France), E.ON (Germany), Suez (France)','Wrench','bg-teal-100 text-teal-700','Services and utilities are modernizing infrastructure through digital platforms, smart utility systems, and sustainability initiatives. Outsourcing, automation, and energy efficiency are driving operational transformation.',_binary '','::1','2025-01-09 01:07:20',2,NULL,NULL);
