ial for investment decisions. Fantastic team!','2025-02-06 17:20:02','2025-02-06 17:20:02'),(7,'Linda Chen','linda.chen@example.com','Research Director','Huawei',5,'The level of detail in their reports is impressive. Core Market Research has consistently provided accurate and actionable data that helps us refine our strategies. A trusted partner!','2025-02-06 17:20:02','2025-02-06 17:20:02'),(8,'Carlos Ramirez','carlos.ramirez@example.com','Marketing Head','Coca-Cola',4,'Insightful reports and deep industry knowledge! Their market research played a key role in shaping our marketing campaigns. Highly professional team with great service.','2025-02-06 17:20:02','2025-02-06 17:20:02'),(9,'Sophie Martin','sophie.martin@example.com','Brand Manager','LVMH',5,'Their research reports gave us the competitive edge we needed. Highly detailed insights and market trends that help in strategic decision-making. Excellent service!','2025-02-06 17:20:02','2025-02-06 17:20:02'),(10,'Hans Muller','hans.muller@example.com','Chief Economist','Deutsche Bank',4,'Core Market Research offers high-quality market intelligence. Their in-depth analysis has been a game-changer for our strategic planning. Highly recommended for businesses.','2025-02-06 17:20:02','2025-02-06 17:20:02');
